import Layout from "../components/Layout";

const Register = () => {
  const registerForm = () => <form>form to register</form>;

  return (
    <Layout>
      <div className="col-md-6 offset-md-3 mt-5">{registerForm()}</div>
    </Layout>
  );
};

export default Register;
